INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(1, 'Sosok Penghuni Asrama Mahasiswa yang Sebenarnya', 'Saya sebenarnya jarang percaya mengenai hantu dan sejenisnya. Bagi saya, hal-hal semacam itu hanya ada di televisi, film juga buku fiksi saja. Bukan di dunia nyata. Tapi, pandangan saya berubah seketika ketika sudah memasuki dunia kuliah. Tepatnya ketika pindah dan menetap di asrama mahasiswa.\r\n\r\nKetika kuliah, jarak yang jauh antara kampus dan rumah membuat saya memutuskan untuk tinggal di sekitar kampus saja. Saat itu, bersama beberapa teman, kami memutuskan untuk tinggal di asrama saja. Selain fasilitas yang bagus, lokasi yang berada di dalam area kampus juga harga yang terjamin, keamanannya juga oke. Peraturan di sana juga lumayan ketat sehingga jarang terjadi kecolongan. Kegiatannya pun sejalan dengan keinginan saya dan yang paling penting, tiap kamar memiliki satu orang senior sebagai penanggung jawab.\r\n\r\nNamun, citra asrama mahasiswa yang baik tersebut berubah buruk di mata saya juga teman-teman yang lain. Pasalnya, sudah bukan rahasia umum, asrama mahasiswa tentu punya banyak penghuniselain dari mahasiswa itu sendiri.\r\n\r\nPeristiwa itu terjadi ketika di masa-masa ospek. Saat itu adalah masa-masa paling sibuk sebagai mahasiswa baru. Ada banyak tugasbaik kelompok maupun individusebagai syarat mengikuti ospek. Menulis beragam review serta menghafal beberapa lagu. Tentu saja, semuanya dikerjakan di malam hari karena waktu siang sudah habis terpakai untuk kegiatan ospek.\r\n\r\nSaat itu, asrama mahasiswa tempat saya bernaung memiliki peraturan: di atas pukul 10 malam, semua mahasiswa sudah harus ada di asrama. Jika terlambat dan pintu gerbang sudah ditutup, mahasiswa yang terlambat tidak diizinkan masuk. Maka, sebagai maba yang patuh, saya memilih mengerjakan tugas-tugas saya di kamar, teman saya yang lain mengerjakannya di ruang terbuka asrama.\r\n\r\nSekitar dini hari, ketika sebagian besar anggota asrama sudah terlelap, saya baru saja menyelesaikan tugas ospek individu. Teman saya yang lain tampaknya masih asik di luar. Ketika saya berniat akan tidur, dia tiba-tiba saja masuk ke dalam kamar dengan napas ngos-ngosanseperti habis berlari. Melihat saya masih terbangun, dia sontak bercerita: Tadi ada yang memperhatikan saya di kaca sebelah ruang terbuka asrama. Haduh, saya jadi susah tidur malam itu.\r\n\r\nSetelah peristiwa tersebut, berturut-turut kami sering diganggu. Mulai dari pintu yang diketuk-ketuk pelan di malam hari (khususnya dini hari) hingga suara ketukan halus di bawah meja duduk yang sedang kami duduki. Ya ampun, kami otomatis lari terbirit-terbirit.\r\n\r\nSaya dan teman-teman kemudian berinisiatif curhat pada senior penanggung jawab kamar kami. Bertanya dengan halus tanpa ada niat menyinggung, apakah benar di asrama ada hantunya?\r\n\r\nSenior tersebut hanya tertawa. Dia mengangguk dan bertanya dengan enteng, apakah kami sudah diganggu? Tentu saja kami sontak mengangguk. Si senior kemudian berkata, hal itu sudah biasa terjadi. Anggap saja sebagai sarana awal ospek mahasiswa di asrama ini. Bedanya, yang ngospekin mahasiswa bukan kakak panitia ospek, melainkan penghuni asrama yang sebenarnya, alias hantu. Si senior itu juga berkata kalau hal ini nggak akan lama. Kalau si hantu sudah kenal, lama-lama akan berhenti sendiri. Ya ampuuuun.\r\n\r\nSelang beberapa lama, perkataan si senior benar adanya. Sosok hantu penghuni asrama sudah berhenti mengganggu. Saya dan teman-teman sekamar sudah kembali beraktivitas normal. Sibuk mengikuti banyak kegiatan, mengerjakan tugas hingga beradaptasi dengan dunia perkuliahan yang sangat berbeda dengan dunia SMA.\r\n\r\nHingga suatu hari, saya dan satu orang teman lainnya mengalami hal aneh lagi. Saat itu, saya terpaksa harus bergadang saking banyaknya tugas yang harus dikerjakan. Entah hingga pukul berapa, saya lupa. Yang jelas hingga dini hari, pun juga dengan teman saya. Saat iru, karena keterbatasan kursi, teman saya mengerjakan di luar, soalnya dia juga lumayan pemberani, saya mengerjakan di kamar.\r\n\r\nKetika sudah selesai, saya memutuskan naik ke kasur. Saat itulah, saya mendengar bunyi pintu dibuka dan ditutup, disusul keran air di luar yang menyala lalu berhenti. Awalnya, tentu saja saya mengira itu teman saya yang ada di luar, masuk ke kamar berniat tidur. Saya neyeletuk, Tugasnya udah? lalu memutuskan memejamkan mata. Pertanyaan itu sebenarnya cuma basa-basi saja, hanya sebagai salam sapa sebelum tidur.\r\n\r\nNamun, karena tak kunjung dijawab, saya memutuskan untuk membuka mata. Menoleh ke kasur teman saya dan ternyata kosong. Saat itulah, bulu kuduk saya langsung berdiri. Keringat tiba-tiba saja mengalir. Hayoloh, lalu siapa yang tadi membuka pintu dan menyalakan keran air?\r\n\r\nSelang beberapa lama, teman saya masuk ke kamar. Dia bingung melihat saya menatap pintu, lalu bertanya:\r\n\r\nAda apa?\r\n\r\nKamu tadi masuk ke kamar?\r\n\r\nNggak\r\n\r\nTeman saya menjawab yakin. Saya cuma bisa melengos, lalu memutuskan kembali merebahkan diri di kasur, mencoba memejamkan mata. Saat itulah, teman saya berkata lirih.\r\n\r\nTapi, tadi saya memang lihat ada yang keluar dari kamar ini.\r\n\r\nHish, berarti saat mengerjakan tugas, saya sedang ditemani sama makhluk halus. Halah, tau gitu saya minta tolong saja untuk dikerjakan tugasnya. Jadinya nggak perlu capek apalagi sampai bergadang. (*)\r\n\r\nSumber : https://mojok.co/terminal/sosok-penghuni-asrama-mahasiswa-yang-sebenarnya/', , '2020-10-01', '2020-10-25', 1, 2);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(2, 'Diganggu Suara Gaib Saat Bernyanyi di Kamar Mandi', 'Selain sebagai tempat untuk membersihkan diri, seringkali kamar mandi menjadi tempat terbaik dalam berkontemplasi bagi seseorang. Pasalnyaentah kenapabeberapa ide yang tidak terpikirkan sebelumnya tiba-tiba dan seringkali muncul saat berada di kamar mandi tanpa harus berpikir keras. Tanpa adanya paksaan berpikir, bahkan cenderung mengalir begitu saja.\r\n\r\nSelain itu, rasanya sudah menjadi hal yang biasa seseorang menjadikan kamar mandi sebagai tempat untuk menuangkan bakat terpencar terpendamnya dalam bernyanyi. Mau dirasa suaranya bagus atau tidak, pitch controlnya tepat atau tidak, itu urusan belakangan. Terpenting, pede yang diutamakan. Apalagi hanya bernyanyi di kamar mandi. Tentu tidak akan sampai mendapat interupsi dari para juri sekelas Mas Anang Hermansyah atau Agnez Mo.\r\n\r\nSaya adalah salah satu orang yang seringkali bernyanyi di kamar mandikhususnya pada saat mandi. Lha gimana, bagi saya yang buta nada dalam bernyanyi dan seringkali fals, suara saya terdengar sedikit merdu saat di kamar mandi. Ya, meskipun hanya sedikit tapi bisa menghibur diri, lah. Sebab, berharap dihibur oleh orang lain terkadang sulit. Jadi, menciptakan hiburan bagi diri sendiri merupakan suatu pilihan.\r\n\r\nMeskipun kebiasaan saya dalam bernyanyi tidak mungkin pernah diinterupsi dan diberi penilaian oleh Mas Anang, namun Ibu seringkali memberi wejangan agar sebaiknya tidak bernyanyi di kamar mandi. Pasalnya, usut punya usut, menurut Ibu hal itu termasuk pamaliistilah yang digunakan untuk sesuatu yang dilarang berdasarkan kepercayaan orang terdahulu. Kabarnya, jika sedang apes, bisa-bisa ada suara lain yang mengikuti.\r\n\r\nSaya pikir, namanya juga kepercayaan, dipercaya atau tidaknya ya bergantung pada pemikiran seseorang. Apalagi itu merupakan kepercayaan orang dulu, bisa dikategorikan sebagai mitos juga, lah. Awalnya pikir saya sih begitu. Sampai akhirnya, ada suatu kejadian menyebalkan yang menimpa saya pada saat mandi di malam hari.\r\n\r\nKala itu, saya memang sedang pulang sedikit malam dari kampus, karena ada beberapa kegiatan yang harus saya ikuti. Tercatat saya tiba di rumah sekira pukul 22.00. Saya hampir selalu mandi setelah bepergian dari luar, tujuannya sih untuk membersihkan diri, karena seringkali tidak betah jika tidur dalam kondisi badan yang lengket karena keringat menempel. Dan seperti biasa, ketika mandi ya sambil bernyanyi.\r\n\r\nMalam itu gerimis, semua lampu di rumah sudah dimatikan karena Ibu dan Bapak sudah tidur. Saya mulai masuk ke kamar mandi dan bersiap pada guyuran pertama menggunakan gayung yang tersedia. Lagu yang saya nyanyikan sewaktu mandi terbilang random, bahkan tak jarang hanya menirukan nadanya saja.\r\n\r\nSambil keramasmenggosokan sampo ke area rambutsaya menyanyikan lagu Peterpan-Mungkin Nanti, memasuki reff mulai terdengar suara tawa anak kecil seakan berada di sekeliling saya. Saya hentikan sejenak aktivitas bershampoo untuk memastikan. Suara anak kecil sudah tidak, namun bulu kuduk berdiri bersamaan dengan hilangnya suara tersebut. Sudahlah sedang gerimis, ditambah ada suara ghaib terdengar. Bukan suatu hal yang mengherankan jika saya mulai merasa takut.\r\n\r\nMau tidak mau, saya tetap melanjutkan mandi. Dalam keasikan saya ketika bernyanyi, ada suarayang entah dari mana asalnyalain terdengar. Kali ini, persis di sebelah telinga saya ada yang berbisik, papa.. papa... Seketika saya langsung terbelalak. Lha, gimana, kala itu saya masih kuliah dan belum memiliki anak, kok sudah ada yang memanggil papa. Rasanya ingin segera menyelesaikan mandi tapi ya masih pakai sabun dan belum dibilas.\r\n\r\nKemudian, menyelesaikan mandi secara efisien menjadi pilihan utama. Untuk sementara, nggak perlu lah menyanyikan satu lagi dari intro hingga selesai. Yang penting jangan sampai sosok lain malah muncul di kamar mandi. Kan, ngeri.\r\n\r\nSaya pikir, godaan dari makhluk tak kasat mata sudah selesai. Nyatanya, ketika saya sedang mengeringkan anggota badan dengan handuk, malah ada lanjutan suara tangisan yang kemungkinan besar berasal dari mba kuntilanak yang membuat saya secara otomatis langsung lari keluar dari kamar mandi.\r\n\r\nSetibanya di kamar dan sudah memakai baju tidur, saya langsung rebahan sambil mengenakan selimut. Dari balik selimut saya merasa ketakutan dan rasanya tidak ingin lagi bernyanyi di kamar mandiapalagi pada malam hari. Ketakutan pun bertambah ketika saya mengingat salah satu adegan di film Pocong 2, ketika Risty Tagor tidur, guling yang ada di sebelahnya berubah menjadi pocong. Kualitas istirahat saya pada malam itu pun seketika berkurang karena merasa panas-dingin. (*)\r\n\r\nSumber : https://mojok.co/terminal/diganggu-suara-gaib-saat-bernyanyi-di-kamar-mandi/', , '2020-10-02', '2020-10-25', 1, 2);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(3, 'Cerpen Lucu Singkat', 'Pada suatu ketika terdapat dua orang sahabat sebut saja namanya Gino dan Giri yang senang untuk pergi ke pasar baru guna membeli sepatu. Gino sangat senang membeli sepatu, kesenangannya bertambah saat Gino dapat membelikan Giri sepatu juga. Mereka mendapatkan sepatu futsal impian mereka pada sebuah toko setelah berkeliling pasar.\r\n\r\nSetelah memilih-milih jenis sepatu mana, akhirnya mereka menemukan sepatu yang cocok di hati dan sepakat untuk membeli dua pasang sepatu dengan harga Rp. 300.000. akan tetapi ketika Gino akan membayar ternyata uang cash yang Gino bawa hanya Rp. 100 ribu saja. Kemudian Gino menyuruh Giri untuk mengambil uang di ATM milik Gino, untuk itu Gino menyerahkan dompetnya kepada Giri.\r\n\r\nGiri sini panggil Gino.\r\n\r\nIya No, jadi ini mau bagaimana? Tanya Giri dengan wajah kebingungan.\r\n\r\nGir kamu ke ATM ya dan ambil uang Rp. 200.000 aja di mesin ATM punya  ku. Kamu tahu kan Gir bagaimana cara mengambil uang di ATM? tanya Gino dengan sedikit menyellidik.\r\n\r\nJangan salah No, gini-gini aku tahulah bagaimana cara mengambil uang di mesin ATM itu. Jangan meremehkan orang lain dong No, apalagi ke sahabat sendiri.\r\n\r\nYa sudah, ini bawa saja dompetu. Nanti kalaun sudah berhasil ambil saja uangnya memakai kartu milikku. Terus jika terjadi apa-apa segera hubungi aku yan Gir, jangan lama-lama, nanti kalau kelamaan aku dikira oleh yang jualan pengin beli tapi punya uang\r\n\r\nSiap aku berangkat, nanti kukasih kabar ya kalau uangnya sudah aku ambil, nanti kamu aku telfon kalu sudah berhasil.\r\n\r\nYa sudah cepet berangkat, aku tunggu di sini, tapi inget agak cepet ya kata Gino tidak sabaran.\r\n\r\nSelang 15 menit Gino menunggu Giri, Akhirnya Giri menelfon Gino dan berkata : Reng, waduh reng celaka kita.\r\n\r\nCelaka bagaimana Gir jawab Gino kebingungan.\r\n\r\n Uang di mesin ATM gak mau di ambil No, kartu kamu juga di tolak terus mirip dengan ATM  punyaku dan sudah ku tanyakan ke satpam, katanya kalo terus dimasukin akan ke rejeck terus. Jelas Giri panjang lebar.\r\n\r\nWah masa sih? tanya Giri penuh curiga, soalnya dia baru saja mengubah kartu ATMnya\r\n\r\nTerus bagaimana ini? Apa mending tidak usah.?  Kayanya akan lebih baik jika di batallin saja beli sepatunya. Besok aku mau nayain langsung ke pihak distributor sehingga harga yag didapat kan akan semakin murah.\r\n\r\nEmang kartu mana yang kamu masukin Gir? Tanya Gino dengan penuh penasaran.\r\n\r\nItu tadi kartu yang aku masukin yang ada nama, tanggal lahir dan data diri kamu nya No, yang ada fotonya juga dan mirip sama kamu Gin.\r\n\r\nInnalillahi, sampai lebaran kucingpun gak bakal bisa diambil uangnya, mana ada sejarah KTP digunakan untuk mengambil uang di ATM\r\n\r\nSumber : https://thegorbalsla.com/cerpen-lucu/', , '2020-10-03', '2020-10-25', 1, 1);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(4, 'Burung Pipit Berbicara?', 'Di suatu negeri antah barantah hiduplah seorang kakek yang pergi ke berbagai tempat guna mencari sebuah kebahagiaan. Kakek tersebut melihat seekor burung pipit yang sangat indah sehingga menarik perhatiannya pada sebuah oase. Kakek tersebut mencoba untuk menangkapnya dan berhasil.\r\n\r\nTernyata burung pipit ini dapat berbicara kakek tolong lepaskan saya, saya janji nanti semua permintaan kakek akan saya penuhi, kata si burung pipit.\r\n\r\nBaiklah akan aku lepaskan apabila kau dapat menjawab pertanyaan dari ku. Kata sang kakek.\r\n\r\nKatakan saja wahai kakek, semua pertanyaanmu pasti akan aku jawab. Jawab si burung.\r\n\r\nDi mana, bagaimana, serta kapan kebahagiaan itu akan saya peroleh? tanya sang kakek.\r\n\r\nPertama, jangan percaya kepada seiapapun selain Tuhan, ke dua, kakek jangan terlalu berharap kepada sesuatu yang kakek sendiri tidak sanggup untuk melakukannya. Dan ke tiga, jangan sesekali menyesali masa lalu jawab sang burung dengan penuh jelasnya.\r\n\r\nKarena merasa puas dengan jawaban sang burung, akhirnya kakek melepaskan burung pipit tersebut. Akan tetapi begitu dilepas oleh sang kakek burung pipit tersebut meledek kakek tua tersebut. Dasar kakek bodoh, kata si burung. seandainya tadi kakek tidak melepaskan saya, maka kakek akan saya berikan telur emas.\r\n\r\nSetelah mendengar jawaban dari si burung, sang kakek merasa sangat menyesal dan berusaha untuk mengejar burung tersebut. Si burung akhirnya hinggap di ranting pohon cemara.\r\n\r\nKarena merasa penasaran kemudian sang kakek berusaha untuk memanjat pohon cemara dan kemudian dia terjatuh dan pingsan. Saat kakek tua siuman, burung pipit tersebut kemudian mendekatinya dan  berkata\r\n\r\nDasar manusia, padahal baru beberapa menit saya berikan petunjuk untuk meraih kebahagiaan, namun sudah lupa saja.  Kakek ingat kan tentang apa yang tadi saya katakan, kakek jangan percaya kepada siapapun selain Tuhan. Dan saya kan hanya seekor burung, kenapa kakek mempercayai saya?\r\n\r\nKe dua, kan tadi sudah saya katakan, jangan berharap akan sesuatu yang kakek tidak dapat melakukannya, dan tadi kakek memaksakan diri memanjat pohon, padahal kan kakek sudah tua, dan akhirnya kakek terjatuh\r\n\r\nSerta yang ke tiga, jangan sesekali kakek menyesali masa lalu, mengapa tadi kakek menyesal karena telah melepaskan saya? lanjut si burung sambil terbang ke angkasa meninggalkan kakek tua yang hanya diam termenung.\r\n\r\nSumber : https://thegorbalsla.com/cerpen-lucu/', , '2020-10-04', '2020-10-25', 2, 1);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(5, 'Mentari Rindu Senja', 'Sebuah sinar mentari telah berubah warna menjadi jingga. Dimana hal ini menandakan sebuah senja akan terlihat, waktu indah ini merupakan momen paling disukai banyak orang. Termasuk Lani dan Reno, mereka sangat dekat namun bukan sepasang kekasih. Hanya dua insan yang merasa nyaman dengan hubungan pertemanan seperti ini.\r\n\r\nLani tersenyum Reno tau enggak, kalau mentari dan senja merupakan tanda perpisahan. Dimana mereka merupakan pertanda siang yang berakhir dan malam akan datang.\r\n\r\nBagus dong, kan siang berakhir malam datang keindahan senja di gantikan dengan rembulan.\r\n\r\nLani membelai lembut rambut Reno Tapi Ren itu menyedihkan, karena senja akhirnya digantikan. Sama halnya dengan Reno adalah mentari dan Lani adalah senja, akan ada masanya datang rembulan yang butuh sinar dari mentari.\r\n\r\nReno bangkit dari posisi tidurnya dan duduk menatap Lani lekat-lekat Itu enggak akan terjadi karena mentari Cuma suka senja. Lan, aku suka kamu ucap Reno.\r\n\r\nDapat Reno lihat, Lani terkejut namun langsung tersenyum tetapi tanpa menjawab pernyataan cinta Reno, Lani pergi karena mobil jemputannya telah datang. Keesokan harinya Reno menunggu kedatangan Lani di tempat biasanya.\r\n\r\nNamun Lani tidak datang, hingga hari telah berganti minggu dan minggu berganti bulan. Lani tidak pernah datang, rasa rindu Reno tidak tertahan namun gelisah melanda.\r\nMungkinkah Lani tidak menyukai Reno dan merasa kecewa dengan pernyataan cinta Reno. Namun hal itu terbantahkan seketika saat mendapati kabar bahwa Lani telah tiada. Lani terkena penyakit kanker darah dan tidak pernah diceritakan pada siapapun.\r\n\r\nAir mata Reno mengalir dengan deras di pusara Lani Lan, mentari rindu senja. Kalau tahu akan seperti ini aku akan ungkapkan ini lebih cepat Lan ucap Reno dengan sesenggukan.\r\n\r\nSumber : https://www.romadecade.org/cerpen-romantis/#!', , '2020-10-05', '2020-10-25', 2, 3);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(6, 'Keberanian', 'Aku seorang laki-laki cupu yang menyukai seorang wanita sekelasku namanya Riska. Saat ini aku tidak berani untuk menyatakan perasaan pada Riska.\r\n\r\nRiska tidak cantik tapi manis, saat Riska tersenyum akan banyak gula bertebaran. Namun bagaimana aku yang seorang kutu buku bisa mendekati Riska yang seorang anggota dance.\r\n\r\nSaat ini yang dapat aku lakukan hanya memandangi Riska dari jauh. Lalu saat Riska pulang aku diam-diam mengikutinya karena takut ada hal buruk padanya.\r\n\r\nSuatu ketika aku lihat Riska sedang berdebat dengan seorang laki-laki yang lebih tua darinya.\r\n\r\nNamun aku tidak dapat mendengar apa yang mereka perdebatkan. Hingga aku melihat Riska ditarik untuk masuk ke dalam mobil.\r\n\r\nTentu saja aku tidak tinggal diam dan aku berlari mendekati mereka dan menarik Riska pergi. Tentu saja laki-laki itu mengejar kami dan berhasil membalap.\r\n\r\nLaki-laki itu menarikku hingga membuat kacamataku jatuh dan aku langsung mendorongnya dan menendangnya.\r\n\r\nTentu saja laki-laki itu tidak tinggal diam dan hendak melayangkan pukulan padaku. Tidak sengaja saat itu kacamataku diinjak olehnya hingga pecah.\r\n\r\nNamun saat itu Riska langsung menghentikannya. Mas Rizky stop! Dia teman aku. Iya mas nanti aku pulang. Aku inget kok hari ini ulang tahun mama\r\n\r\nSeketika aku melongo, bagaimana nasibku sekarang setelah menendang kakak dari wanita yang aku suka. Riska aku minta maaf ucapku padanya.\r\n\r\nRiska menarik tubuhku dan membenarkan posisiku Aku disini Doni ucap Riska karena aku salah menghadap.\r\n\r\nMaaf ya saya enggak sengaja menginjak kacamata kamu sampai kamu enggak bisa liat dengan jelas, nanti saya ganti\r\n\r\nEnggak papa kak, masih ada cadangan di rumah\r\n\r\nKamu suka Riska? Seketika pertanyaan itu membuat wajahku memanas dan tentu saja memerah.\r\n\r\nNamun aku tidak mau menepis itu Iya kak, saya suka Riska ucapku tegas.\r\n\r\nSumber : https://www.romadecade.org/cerpen-romantis/#!', , '2020-10-06', '2020-10-25', 2, 3);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(7, 'Balas Budi Sang Raja Hutan', 'Ada sebuah perkampungan, dimana disana ada seorang pemuda yang miskin dan hidupnya juga hanya sebatang kara. Ia adalah pemuda yang sabar, tabah, dan baik hati meskipun hidupnya miskin.\r\n\r\nBahkan ia saja hanya tinggal di sebuah gubuk peninggalan orang tuanya, gubuknya pun sudah rapuh dan kurang layak untuk ditinggali. Pekerjaan sang pemuda hanyalah pencari kayu bakar di hutan, dan ia bisa mencukupi kebutuhannya dari sana.\r\n\r\nSuatu ketika sang pemuda sedang mencari kayu bakar di hutan dan ia pun mendengar suara yang aneh dari balik semak-semak. Ia pun mencoba mendekati dan mengecek apa yang ada di balik semak tersebut, lantas ia menemukan seekor singa yang meraung kesakitan.\r\n\r\nSang pemuda cemas dan melihat keadaan singa tersebut, dan ternyata ada serpihan kayu tajam yang bersarang di punggung sang raja hutan. Sang pemuda merasa takut namun ia juga prihatin akan keadaan singa, karena ia juga iba akhirnya ia menenangkan singa dengan apa yang ia bisa.\r\n\r\nDengan segenap keberanian ia mendekati dan menengkan singa dengan ucapannya bahwa ia akan menolong dan tidak memburu. Sang singa pun mulai tenang dan mempersilahkan sang pemuda untuk mendekati dan menolongnya. Setelah itu sang pemuda mencabut serpihan tajam pada punggung singa.\r\n\r\nNamun kemudian ia langsung lari terbirit-birit karena takut diserang dan dimangsa oleh singa. Sekembalinya ia dari mencari kayu bakar di hutan ia mengalami ketidak sengajaan menabrak kereta kencana raja yang membuat kereta menjadi terbalik.\r\n\r\nIa pun segera bersimpuh dan meminta maaf, namun sang raja tidak terima dan memerintah pengawal untuk menangkap dan memenjarakan sang pemuda malang. Setelah ia menjalani beberapa hari di balik jeruji besi, ia dijatuhi hukuman mati.\r\n\r\nIa beri hukuman mati dengan dimasukkan ke dalam kandang binatang buas dengan ruangan yang gelap. Ia sudah berpasrah dan akan menerima takdirnya kalau nanti tewas di mangsa oleh binatang buas tersebut.\r\n\r\nNamun sampai beberapa saat ia tidak merasakan ada serangan binatang buas dan binatang yang ada disitu juga tidak menyentuhnya sama sekali. Setelah hari beranjak siang ia pun penasaran hewan apa, dan sudah mulai ada cahaya yang masuk.\r\n\r\nAlangkah terkejutnya sang pemuda ketika ia menemukan singa yang diselamatkannya tempo lalu ada di kandang tersebut. dan ternyata sang singa adalah salah satu peliharaan kesayangan sang raja. Sang pemuda pun bertanya mengapa sang singa tidak mematuhi perintah tuannya untuk memangsa si pemuda. Namun sang singa menjawab bahwa ia tak akan mungkin memangsa orang yang telah menyelamatkan hidupnya.\r\n\r\nSumber : https://made-blog.com/contoh-cerita-fantasi/', , '2020-10-07', '0000-00-00', 3, 4);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(8, 'Sepasang Saudara Penyihir', 'Kekuatan sihir adalah yang yang biasa dimiliki manusia, dan di suatu desa ada sepasang saudara kembar. Nama sepasang saudara kembar itu adalah Marco dan Billie, memang bukan nama yang mirip.\r\n\r\nMeskipun keduanya adalah saudara kembar sepasang bersaudara ini memiliki sifat dan watak yang berbanding terbalik. Marco adalah tipe orang yang sombong, angkuh, dan arogan. Sedangkan Billie adalah tipe anak yang baik hati dan suka menolong.\r\n\r\nMarco memang lebih kuat penguasaan sihirnya sudah menguasai berbagai ilmu sihir. Namun karena kemampuannya itu ia menjadi sombong dan selalu memamerkan kemampuannya kepada orang lain. Billie yang merupakan sang kakak pun menasehati dan melarang Marco melakukan hal itu sembarangan karena berbahaya.\r\n\r\nTetapi Marco adalah orang yang keras kepala dan juga selalu mengelak, mengatakan bahwa Billie hanya iri dengan kemampuan Marco. Sikap arogan Marco semakin menjadi-jadi bahkan ia mengubah segala benda menjadi batu dengan mantranya tidak peduli apapun itu.\r\n\r\nSemua benda di rumahnya pun juga ia ubah menjadi batu, hingga satu benda yang belum yaitu cermin. Marco pun berdiri menghadap cermin dan membaca mantranya, namun setelah itu mantranya malah memantul ke arahnya dan ia pun terjebak mantranya sendiri menjadi batu.\r\n\r\nBillie yang melihat hal tersebut pun langsung panik, sehingga ia segera menemui guru sihirnya supaya bisa membebaskan sang adik dari sihir yang ia buat sendiri. Namun sayangnya mantra tersebut tidak bisa diubah dan ditangkal karena merupakan mantra yang abadi. Sekalipun bisa diubah itupun hanya bisa jika yang melakukan si pembaca mantra tersebut.\r\n\r\nSumber : https://made-blog.com/contoh-cerita-fantasi/', , '2020-10-08', '0000-00-00', 3, 4);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(9, 'Misteri Dua Wanita Tak Kasat Mata', 'Malam semakin larut, embusan angin malam semakin kencang. Daun-daun bergoyang seirama, terlihat begitu indah dalam keremangan. Tapi, kedua mata ini menangkap satu keganjilan yang tak pernah kutemui sebelumnya.\r\n\r\nAku melihat seorang wanita yang menggandeng anak kecil. Mereka mengenakan pakaian yang sama, putih nan lusuh.\r\n\r\nAku ingin berlari, tetapi kursi kayu ini seolah menahan tubuhku. Leherku menjadi kaku, dan terasa dingin seolah ada embusan nafas seseorang dari arah belakang. Aku hanya bisa memejamkan mata, mendengar suara tangisan anak kecil yang merintih, meminta tolong entah pada siapa. \r\n\r\nDetik selanjutnya, aku mencium aroma busuk yang menyengat. Dan, tiba-tiba saja wajahku terkena percikan. Darah! Tubuhku menggigil saat menyadari bahwa wajahku terkena percikan darah. Aku ingin sekali memberontak, tetapi rasanya seperti ada yang mengikat tubuhku di kursi ini.\r\n\r\nEmbusan angin malam kembali terasa menusuk kulit. Pijar lampu di teras rumah meredup, tidak seperti biasanya. Daun-daun di pepohonan yang sebelumnya mengalun begitu indah berubah menjadi menyeramkanseperti digoyang oleh kekuatan gaib.\r\n\r\nWaktu seolah berjalan melambat. Hingga akhirnya, aku melihat rumah kosong di ujung komplek dengan sangat jelas. Rumah yang terlihat membesar, seperti ingin menelanku hidup-hidup.\r\n\r\nKini kursi yang kududuki pun berjalan terseret, membawaku ke dalam sebuah ruangan kecil berdebudan ini sangatlah aneh. Ruangan yang penuh dengan sarang laba-laba dan jejak kaki yang berlumur darah.\r\n\r\nIni adalah rumah kosong yang terlihat begitu besar olehku, beberapa menit yang lalu. Dan, ternyata anak kecil itu berada dalam ruangan ini. Dia duduk di atas ranjang dengan posisi punggung yang membelakangikuhanya berjarak 2 meter. Rambutnya terurai, menjuntai ke lantai. Tangannya memanjang, menggerayangi atap ruangan. \r\n\r\nRuangan kecil seperti bekas terbakar dan rasanya sangat tidak asing bagiku. Hanya saja sekarang terasa berbeda, mungkin dikarenakan kondisi ruangan yang telah rusak parah.\r\n\r\nAku kesulitan mengambil napas, rasanya sangat pengap. Dan, bertambah semakin sulit saat kurasa ada sesuatu beda yang menyentuh ujung kakiku. \r\n\r\nTangan anak kecil itu menggerayangi ujung kaki ini, sedangkan tubuhnya masih duduk di atas ranjang yang sama. Jemarinya perlahan menggerayangi lututku kemudian berpindah pada ulu hati. Jari-jarinya nampak kurus dan pucat, dengan kuku-kuku panjang yang hitam. Sepertinya tubuhku akan terkoyak saat ia berhasil menembus ulu hatiku dan merobeknya.\r\n\r\nSuara gesekan antara pintu ruangan dengan lantai terdengar mengerikan, Pada waktu yang bersamaan, ada rasa sedih bercampur dengan ketakutan yang membuatku menjadi dilema. Rasanya, aku pernah hidup dalam ruangan ini untuk waktu yang lama. Tapi, aku sama sekali tidak mengingatnya. Kecelakaan dari dua tahun yang lalu telah membuatku kehilangan ingatan. \r\n\r\nSaat pikiranku sedang berusaha mengingat kenangan itu, datanglah seorang wanita yang mengenakan pakaian putih cantung berjalan ke arahku. Wajahnya terlihat tak asing bagiku. Usianya pun sepertinya terpaut tak jauh dari usiaku.\r\n\r\nWanita itu segera mendekat, menggenggam jemari anak kecil yang terletak pada ulu hatiku. Mereka menggesekkan kuku-kuku tajamnya pada pakaianku, hingga lepaslah satu persatu kancing bajuku. Dan kini tubuhku terasa sangat dingin, sebab jemari mereka sepenuhnya telah menyentuh kulitku. \r\n\r\nDalam waktu yang bersamaan, tubuh anak kecil itu mendekatikutangannya memendek. Dia duduk di pangkuanku, dan menatapku dengan saksama. Wajahnya terlihat pucat, bibirnya berwarna biru kehitamanserupa dengan lingkaran kantung matanya.\r\n\r\nAnak kecil itu mengalungkan kedua tangannya pada leherku, menyandarkan kepalanya pada dadaku. Dia memperlakukanku seolah aku ini adalah ayahnya. Aku yang benar-benar ketakutan pun tak kuasa untuk berbuat sesuatu. Kecuali, tetap menjaga kesadaranku sendiri. \r\n\r\nSaat aku mencoba untuk memahami semua kejadian ini. Tiba-tiba wanita paruh baya yang berdiri di hadapanku menatapku dengan penuh kesenduan. Dia melepaskan sentuhannya dari ulu hatiku, menyibukkan tangannya dengan merapikan rambutnya, dengan menggunakan sisir berwarna coklat.\r\n\r\nAku melihat dengan jelas potongan-potongan kulit kecil yang terkelupas, dan berwarna hitam saat ia menyisiri rambutnya. Ada gumpalan nanah pada wajah sebelah kanannya. Urat-urat tipis di wajahnya pun seolah berjalan, kemudian menembus gumpalan nanah itu.\r\n\r\nAroma amis bercampur busuk menyeruak ke dalam hidungku. Gumpalan nanah itu telah pecah. Wajah wanita itu semakin mengerikan. Seluruh kulitnya terkoyak, pori-pori pada wajahnya mengelurkan darah serta nanah. \r\n\r\nTiba-tiba saja wanita itu menarik anak kecil yang berada di pangkuanku, dan membaringkannya di atas kasur. Wanita paruh baya itu berjalan dengan sangat kaku. Tangannya menunjuk ke arah wajahku, sembari mendekatkan wajahnya hingga akhirnya kami saling bertatapan.\r\n\r\nPupil matanya berlubang dan mengeluarkan ulat-ulat kecil yang terus saja berjatuhan. Kulihat bayang kesedihan dari kedua bola matanya yang berwarna putih. Wanita itu menganga dengan sangat lebar, memperlihatkan giginya yang hitam dan tajam. Lidahnya yang terkoyak menjulur meneteskan liur di kakiku.\r\n\r\nAku meneteskan air mata, seolah merasakan sebuah kesedihan yang dirasakannya. Anak kecil yang duduk di atas ranjang itu pun berjalan dan kembali mendekatiku. Dia memelukku dari arah belakang. Sedangkan wanita di hadapanku berusaha untuk membisikkan sesuatu padaku.\r\n\r\nRambutnya yang panjang terkesiap seketika. Memperlihatkan lehernya yang sudah membusuk. Kedua mataku pun tak sengaja menatap satu benda yang melekat pada lehernya. Dan, menjadikanku tidak peduli lagi pada apa yang akan terjadi padaku.\r\n\r\nRuangan ini begitu gelap. Namun aku dapat melihat dengan jelas benda itu pada lehernya. Seolah Tuhan sedang memberiku keajaiban. Aku sudah tidak peduli meski wanita itu terus menjilati leherku dengan lidahnya yang busuk lagi menjijikkan itu. \r\n\r\nSemua terasa begitu dekat denganku. Aku seperti mengenali semuanya. Apa yang pernah terjadi antara aku dan mereka? \r\n\r\nKepalaku menjadi sangat berat. Sepertinya otakku sedang mengumpulkan puing-puing ingatan masa laluku sejak wanita itu membisikkan sesuatusesuatu yang tidak dapat kumengerti sama sekali.\r\n\r\nKalung. Aku pernah memakaikan kalung itu pada seorang wanita yang pernah kunikahi. Tatapi, tujuh tahun setelah kami bersama, aku meninggalkan istri dan anakku, sebab ada sebuah tugas yang harus kupertanggung jawabkan di luar kota. \r\n\r\n&quot;Anak kecil ini?&quot; Aku bertanya dalam batinku sendiri.\r\n\r\nAir mata terurai begitu saja dari kedua sisi mataku. Kedua sosok menyeramkan itu pun dengan cepat berjalan menjauhiku. Mereka berdiri menghadapku, menyuguhkan senyuman yang begitu manis dan membersamainya dengan lambaian tangan.\r\n\r\nSaat itu, mereka menunjukkan sebuah kaset dan radio kecil yang terletak di atas meja yang sudah tak utuh lagi. Tanpa pikir panjang, aku pun segera berdiri dan meraihnya. Hatiku yakin, bahwa ada sesuatu yang ingin mereka sampaikan padaku melalui benda itu.\r\n\r\nDengan sigap, aku memutar rekaman pada kaset yang terletak dalam radio kecil itu. Mendengarkannya dengan saksama.\r\n\r\nAku mendengar suara jeritan dan juga benturan antar benda dalam sebuah ruangan. Mereka berteriak, meminta tolong pada seseorang untuk memadamkan api dan juga melepaskan ikatan pada tubuh mereka.\r\n\r\nTak lama dari permintaan itu, aku pun kembali mendengarkan sumpah serapah untuk seseorang yang membakar mereka. Sepertinya suara itu adalah suara istriku. Dia bersumpah akan memberikan hukuman yang setimpal pada mereka setelah berhasil memberitahuku.\r\n\r\nAku pun menangis penuh penyesalan setelah mendengarkan semuanya. Istri dan anakku telah mati. Mereka membunuh keluargaku.\r\n\r\nKupandangi kepergian kedua wanita terkasihku. Rasanya, aku tak layak lagi untuk hidup. Tapi, aku harus membalaskan dendam Ningsing, istriku. Pada mereka, pembunuh yang tidak pantas dibiarkan hidup dengan bahagia di atas penderitaan istri dan anakku.\r\n\r\nNingsih, aku akan membalaskan dendam keluarga kita!\r\n\r\nSumber : https://www.idntimes.com/fiction/story/kaila/cerpen-misteri-dua-wanita-tak-kasat-mata-c1c2/full', , '2020-10-09', '2020-10-25', 4, 2);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(10, 'Mendapat Telpon Dari Alam Ghoib', 'Waktu itu Ngadi akan menyeribu (nyewu) ibunya yang telah meninggal dunia 3 tahun yang lalu. Ngadi merasa sedih sebab tidak punya uang (dua bulan tidak bekerja).\r\nUntuk kendurian sederhana paling tidak memerlukan beaya minimal Rp. 2.000.000. Ia baru mempunyai uang satu juta, ayahnya mempunyai uang Rp. 200.000,- Ia merasa sedih untuk keperluan itu mau hutang dimana.\r\n\r\nDalam keadaan galau itu ada telpun dari seseorang isinya menghibur dan janji: Halo Ngadi jangan sedih saya bantu besok malam Selasa Kliwon saya akan menjumpai engkau. Kemudian telpun terputus tidak bisa dihubungi.\r\nNgadi menjadi bingung siapa yang tilpun sudah tidak bisa dihubungi. Ia selalu memikirkan siapa yang akan menjumpainya. Pada malam Selasa Kliwon ia selalu menanti siapa yang akan menjumpanya. Sampai jam 24.00 WIB malam Selasa Kliwon belum ada yang menjumpainya.\r\n\r\nAkhirnya Ngadi tertidur, tidak antara lama Ia bermimpi didatangi wanita yang berpakaian putih, memakai cadar, mengenakan ikat pinggang merah, tangannya memegang kipas. Wanita itu bilang : Di kalau tidak punya uang angkatlah genuk (tempat beras) di kamar belakang di bawahnya ada rezeki ambilah.\r\n\r\nNgadi terbangun suara orang yang berpakaian putih itu seperti suara ibunya yang telah meninggal 3 tahun yang lalu, tetapi rupanya berbeda sekali. Ngadi agaknya kurang percaya apa yang dikatakan wanita dalam mimpinya itu.\r\nIa mengajak ayahnya untuk mengangkat genuk itu. Astaga di bawah genuk itu memang ada kotak kecil dari kayu. Kemudian kotak itu dibuka ada emas beserta suratnya dari toko emas tersebut beratnya ada 15 gram. Ayahnya lalu ingat bahwa emas itu kiriman dari putra sulungnya yang merantau di luar Jawa. Oleh ibunya Ngadi emas itu disimpan di bawah genuk dan tempat itu jarang disentuh jadi wajar kalau ayahnya punya emas itu.\r\n\r\nNgadi merasa senang dan emas tersebut dibawa ke toko emas dan dijual. Siapa yang berbusana putih itu Ngadi tidak tahu hanya suaranya Ngadi masih ingat itu suara ibunya.\r\nDengan dijualnya emas tersebut maka beaya untuk memperingati 1000 hari meninggalnya ibunya Ngadi telah tercukupi bahkan masih ada sisa. Jadi jelas ada campur tangan Tuhan di dalam kehidupan Ngadi. Ia sedih butuh uang Tuhan pun mengasih jalan untuk mendapatkan uang lewat mimpinya. Sejak itu ngadi punya semboyan Kerja keras banyak berdoa Tuhan selalu mengabulkan cita-citanya.\r\nBapaknya Ngadi sedikit demi sedikit penyakitnya sembuh.\r\n\r\nSumber : \r\nhttps://www.harianmerapi.com/kearifan/cerita-misteri/2020/10/20/110042/mendapat-telpon-dari-alam-ghoib-2-habis-mirip-suara-ibunya-yang-telah-meninggal', , '2020-10-10', '2020-10-25', 4, 5);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(11, 'Cerita Pendek Ini Tercipta Karena Petualangan Panj', '\"Kamu bukan pemimpi, Dok. Profesimu serius, dengan etika yang mempersyaratkan disiplin tinggi dan rambu-rambu yang ketat. Tidak mungkin berkisah indah seperti kami-kami para penghayal maya yang menggunakan pena sebagai penyambung lidah....\"Kata si Kurasiana, pengamat fiksi disini dengan senyum termanis walau dengan nada suara sinis, tetap membuat hati melankolis.\r\n\r\n\"Enggaklah, sebelum jadi dokter aku juga penghayal dan sekarang pun aku berharap kamu selalu membaca tulisanku dan mengaguminya ...\" Kataku pada si editor beberapa kumpulan cerpen, puisi, prosa, dongeng keroyokan dan buku-buku hasil event on-line lainnya.\r\n\r\nBeberapa bulan kemuadian dia terkejut bahwa aku sudah bisa membuat beberapa cerpen yang trendy dengan kondisi terkini.\r\n\r\n\"Boleh, juga, Dok. Kamu menyindir beberapa kondisi politik terkini seperti kasus korupsi politikus, tim sukses pilkada yang usahanya menjadi sepi sampai ancaman teman-teman yang akan pindah ke kota lain karena tidak cocok dengan gubernur baru .\" Mama muda yang suaminya kerja di penerbitan ternama itu mulai memilah-milah tulisanku yang cukup masuk radar \"wajib baca\" penikmat fiksi.\r\n\r\n\"Aku juga bikin beberapa tulisan romantis yang melibatkan wanita penggoda, tidak jadi menikah karena si wanita merasa tidak mungkin membahagiakan si pria, gagal menikah karena bapak si gadis dan romantisme kota Macao ...\"Kataku menambahkan, karena cerpen itu harus ada romantismenya juga, bukan?\r\n\r\n\"Kamu juga kelihatan takut tersaingi dokter aplikasi, ya? Dan ini pasti membahas Kompasianival 2017 lalu yang pindah tempat mendadak. Okelah, dokter berhasil membuat cerpen yang lumayan, tetapi masih medioker, belum ada yang headline,sih...\" Katanya menantangku untuk terus belajar membuat fiksi lebih moncer yang membuat admin bidang fiksi klepek-klepek membacanya .\r\n\r\n\"Kita berfoto dahulu sebelum bubar? Temanmu yang lain bolehlah diajak, tidak enak hanya berdua... Nanti seperti di tulisanku ini . Hehehehe...\" Aku menunjukkan tulisanku itu dan dia pun geli terbahak.\r\n\r\n\"Iya, bahaya. nanti dipikir suamiku aku kena penyakit berbahaya ketemu kamu. Ayo semua tim editor fiksi, kumpul.....\" Lalu kami pun berfoto bersama. Klik..Klik...Klik...\r\n\r\nSumber : https://www.kompasiana.com/posmasiahaan/5a44cc5916835f148b4d8172/cerita-pendek-ini-tercipta-karena-petualang-panjang-kita', , '2020-10-11', '0000-00-00', 5, 6);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(12, 'Mendaki Gunung Sesean, Puncak Tertinggi Toraja', 'Bermodalkan niat dan informasi dari internet, Oktober 2016 saya melakukan perjalanan sendirian (solo traveling) ke Gunung Padang di Cianjur.\r\n\r\nKarena suka menumpang kereta api, tiap kali melakukan perjalanan moda transportasi yang saya utamakan adalah angkutan publik itu. Cocok sekali; ternyata ada stasiun yang dekat dengan Gunung Padang, yakni Stasiun Lampegan.\r\n\r\nSaya berdomisili di Jakarta. Jadi saya harus naik kereta api beberapa kali. Dari Jakarta saya ke Bogor dulu. Dari Stasiun Bogor Paledang yang terpaut sekitar 200 meter dari Stasiun Bogor, saya kemudian naik KA Pangrango (Rp 50.000 eksekutif, Rp 20.000 ekonomi) ke Sukabumi. Karena penasaran dengan interiornya, saya memesan tiket untuk kelas eksekutif.\r\n\r\nSetiba di Sukabumi, saya mesti lanjut naik kereta api lagi ke Stasiun Lampegan di Cianjur. Kereta relasi Sukabumi-Cianjur adalah KA Siliwangi. Tarif kereta api lokal itu lumayan murah. Saya hanya perlu membayar Rp 3.000.\r\n\r\nRasa letih karena harus berpindah-pindah kereta itu dibayar lunas oleh pemandangan persawahan dan pegunungan indah yang disuguhkan alam sepanjang rel Bogor sampai Lampegan.\r\n\r\nLangsung dihampiri beberapa tukang ojek\r\nBegitu turun di Stasiun Lampegan, saya langsuung dihampiri beberapa tukang ojek yang menawarkan jasa untuk mengantarkan saya ke Gunung Padang.\r\n\r\nMenurut beberapa artikel yang saya baca, tarif ojek dari Stasiun Lampegan ke Gunung Padang berkisar antara Rp 40.000-50.000 ribu sekali jalan.\r\n\r\nHarganya bisa segitu karena jaraknya lumayan jauh dan medannya lumayan menantang. Karena kebetulan saya dari Sunda, saya menawar dengan bahasa Sunda dan akhirnya sepakat dengan harga Rp 50.000 pergi-pulang.\r\n\r\nSelama perjalanan naik ojek, kembali mata saya dibuai oleh pemandangan indah kebun teh dan hutan yang masih asri. Seketika penat saya luluh dan hilang. Saya bersyukur masih diberi kesempatan untuk menghirup udara segar.\r\n\r\nMenapaki ratusan anak tangga menuju puncak Gunung Padang\r\nTibalah saya di loket registrasi Gunung Padang. Setelah membeli tiket, saya bergegas melangkahkan kaki menuju Gunung Padang.\r\n\r\nBerada pada ketinggian 885 mdpl, untuk menuju puncak gunung tempat situs megalitikum kebanggaan Jawa Barat itu berada saya mesti menaiki ratusan anak tangga.\r\n\r\nUntung saja di puncak ada warung kecil yang menjual makanan dan minuman. Jadi saya bisa istirahat sejenak, mengisi perut dan menawar dahaga setelah menempuh ratusan anak tangga.\r\n\r\nSelain udaranya yang sejuk, puncak Gunung Padang punya pemandangan yang menawan. Yang membuat pemandangan begitu menarik adalah hamparan kebun teh dan beberapa pegunungan yang menjulang.\r\n\r\nSetelah dua jam berkeliaran di areal puncak Gunung Padang, saya pun kembali turun. Dari loket saya balik ke Stasiun Lampegan, terus pulang ke Jakarta.\r\n\r\nSumber : https://pendakiindonesia.com/puncak-gunung-padang/', , '2020-10-12', '2020-10-25', 5, 6);
