(15, '&quot;Beranjak Dewasa&quot; - Lika Liku Pendewasaa', 'Pada akhirnya ini semua\r\nHanyalah permulaan\r\nPada akhirnya kami semua\r\nBerkawan dengan sebentar\r\nBerbaring tersentak tertawa\r\nTertawa dengan air mata\r\nMengingat bodohnya dunia\r\nDan kita yang masih saja\r\nBerusaha\r\nKita beranjak dewasa\r\nJauh terburu seharusnya\r\nBagai bintang yang jatuh\r\nJauh terburu waktu\r\nMati lebih cepat\r\nMati lebih cepat\r\nKita beranjak dewasa\r\nJauh terburu seharusnya\r\nBagai bintang yang jatuh\r\nJauh terburu waktu\r\nMati lebih cepat\r\nMati lebih cepat\r\nPada akhirnya\r\nTirai tertutup\r\nPemeran harus menunduk\r\nPada akhirnya\r\nAku berdoa\r\nNamaku akan kau bawa\r\nBerbaring tersentak tertawa\r\nTertawa dengan air mata\r\nMengingat bodohnya dunia\r\nDan kita yang masih saja\r\nBerusaha\r\nKita beranjak dewasa\r\nJauh terburu seharusnya\r\nBagai bintang yang jatuh\r\nJauh terburu waktu\r\nMati lebih cepat\r\nMati lebih cepat\r\nKita beranjak dewasa\r\nJauh terburu seharusnya\r\nBagai bintang yang jatuh\r\nJauh terburu waktu\r\nMati lebih cepat\r\nMati lebih cepat\r\nKita beranjak dewasa\r\nJauh terburu seharusnya\r\nOh, oh-oh-oh-oh, oh\r\nOh, oh\r\nOh, oh\r\nPada akhirnya ini semua\r\nHanyalah permulaan', , '2020-10-25', '2020-10-25', 6, 3);
INSERT INTO `post` (`idpost`, `judul`, `isi_post`, `file_gambar`, `tgl_insert`, `tgl_update`, `idpenulis`, `idkategori`) VALUES
(16, 'Si Kura-Kura yang Sombong', 'Ada seekor kura-kura yang sombong dan merasa dirinya lebih pantas terbang dibandingkan berenang di perairan. Ia jengkel karena memiliki tempurung keras yang membuat tubuhnya terasa berat.\r\n\r\nIa pun kesal melihat kawan-kawannya sudah berpuas diri dengan berenang. Saat melihat burung yang bebas terbang di langit, kejengkelannya kian bertambah.\r\n\r\nSuatu hari, kura-kura ini memaksa seekor angsa untuk membantunya terbang. Si angsa setuju. Ia mengusulkan agar si kura-kura berpegangan pada sebatang kayu yang akan diangkatnya.\r\n\r\nKarena tangan kura-kura agak lemah, ia menggunakan mulutnya yang lebih kuat. Ia pun akhirnya bisa terbang dan merasa bangga.\r\n\r\nMelihat teman-temannya yang tengah berenang, ia ingin menyombongkan diri. Ia lupa bahwa mulutnya harus terus dipakai untuk menggigit kayu. Ia pun terjatuh dengan keras. Beruntung, ia selamat berkat tempurung yang pernah dibencinya.', , '2020-10-25', '0000-00-00', 10, 4);

